CustomField.formula:
IF(AND(
		OR(ISBLANK(leading_indicator_date__c), leading_indicator_date__c - contracted_at__c > 90), 
		OR(DATEVALUE(first_audit_completed_on__c) - contracted_at__c > 90, ISBLANK(first_audit_completed_on__c)), 
		AND(DATEVALUE(first_audit_completed_on__c) - contracted_at__c > 90, 
			OR(fifth_review_received__c -  contracted_at__c > 90, ISBLANK(fifth_review_received__c)))
		), 	"missed audit and reviews", 
			IF(AND(
					OR(ISBLANK(leading_indicator_date__c), leading_indicator_date__c - contracted_at__c > 90), 
					OR(DATEVALUE(first_audit_completed_on__c) - contracted_at__c > 90, ISBLANK(first_audit_completed_on__c)), 
					AND(DATEVALUE(first_audit_completed_on__c) - contracted_at__c > 90, fifth_review_received__c -  contracted_at__c < 90)
					), 	"missed audit",
						IF(AND(
								OR(ISBLANK(leading_indicator_date__c), leading_indicator_date__c - contracted_at__c > 90), DATEVALUE(first_audit_completed_on__c) - contracted_at__c < 90
								), "missed Reviews", "is Leading"
							)
				)
	)
